INSERT INTO `tcsteps` VALUES (10,1,'<p>Проверить тип сделки на доске поиска сделок</p>\r\n','<p>Выбран тип сделки &quot;Быстрая покупка&quot;</p>\r\n',1,1),(11,2,'<p>Проверить таблицу вывода результатов поиска</p>\r\n','<p>В таблице результатов поиска отображаются все сделки по покупке, подходящие под стандартный фильтр</p>\r\n',1,1),(12,3,'<p>Переключить доску на фильтр &quot;Быстрая продажа&quot;</p>\r\n','<p>В таблице результатов поиска отображаются все сделки по продаже, подходящие под стандартный фильтр</p>\r\n',1,1),(289,1,'<p>Проверить тип сделки на доске поиска сделок</p>\r\n','<p>Выбран тип сделки &quot;Быстрая покупка&quot;</p>\r\n',1,1),(290,2,'<p>Проверить таблицу вывода результатов поиска</p>\r\n','<p>В таблице результатов поиска отображаются все сделки по покупке, подходящие под стандартный фильтр</p>\r\n',1,1),(291,3,'<p>Переключить доску на фильтр &quot;Быстрая продажа&quot;</p>\r\n','<p>В таблице результатов поиска отображаются все сделки по продаже, подходящие под стандартный фильтр</p>\r\n',1,1),(594,1,'<p>Проверить, что выводится меню переходов по сайту</p>\r\n','<p>В хидере выводится меню со значениями:</p>\r\n\r\n<p>1. Купить\\Продать</p>\r\n\r\n<p>2. Вход\\Регистрация</p>\r\n\r\n<p>3. Счета</p>\r\n\r\n<p>4. Панель управления</p>\r\n',1,1),(595,2,'<p>Проверить, что хидер содержит ссылку перехода на главную страницу.</p>\r\n','<p>В левой части хидера находится логотип &quot;fancrypto.ru&quot;. Ссылка имеет значение &quot;https://fancrypto.ru&quot;</p>\r\n',1,1),(596,3,'<p>Проверить, что выводятся&nbsp; информационно-навигационные ссыки</p>\r\n','<p>Футер содержит три блока с ссылками.</p>\r\n\r\n<p>1 Блок - Services:</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Webdesign</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Development</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Hosting</a></li>\r\n</ul>\r\n\r\n<p>2 Блок - About:</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Company</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Team</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Legacy</a></li>\r\n</ul>\r\n\r\n<p>3 Блок - Careers:</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Job openings</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Employee success</a></li>\r\n	<li><a href=\"https://fancrypto.ru/#\" style=\"box-sizing: border-box; color: inherit; text-decoration: none; background-color: transparent; opacity: 0.8;\">Benefits</a></li>\r\n</ul>\r\n',1,1),(597,4,'<p>Проверить, что выводится панель перехода на аккаунты в социальных сетях</p>\r\n','<p>В правой части футера выводятся элементы:</p>\r\n\r\n<p>1. логотип faceboock</p>\r\n\r\n<p>2. логотип twitter</p>\r\n\r\n<p>3. логотип instagram</p>\r\n\r\n<p>4. fancrypto.ru&nbsp;&copy; 2017</p>\r\n',1,1),(598,5,'<p>Проверить, что выводится блок &quot;Вход&quot;</p>\r\n','<p>Выводится блок с названием &quot;Вход&quot;, содержит в себе:</p>\r\n\r\n<p>1. Поле ввода &quot;имя пользователя&quot;</p>\r\n\r\n<p>2. Поле ввода &quot;Пароль&quot;</p>\r\n\r\n<p>3. Кнопка &quot;Вход&qu