ер запроса:</p>\r\n\r\n<p>SELECT * FROM sign_ins WHERE username LIKE &#39;Test&#39; ORDER BY created_at DESC;</p>\r\n','<p>Выведены все записи со статусами попыток входа пользователя, первая запись содержит время последнего входа со статусом &quot;success&quot;.</p>\r\n\r\n<p>Пример результата:</p>\r\n\r\n<p>5&nbsp;&nbsp; &nbsp;Test&nbsp;&nbsp; &nbsp;browser&nbsp;&nbsp; &nbsp;2020-08-24 10:45:53.0&nbsp;&nbsp; &nbsp;172.18.0.3&nbsp;&nbsp; &nbsp;success<br />\r\n4&nbsp;&nbsp; &nbsp;Test&nbsp;&nbsp; &nbsp;browser&nbsp;&nbsp; &nbsp;2020-08-24 10:45:30.0&nbsp;&nbsp; &nbsp;172.18.0.3&nbsp;&nbsp; &nbsp;success</p>\r\n',1,1),(660,4,'<p>Проверить, что в БД &quot;identity&quot; в таблице &quot;sign_ins&quot; создана запись о попытке входа пользователя с неправильным паролем . Пример запроса:</p>\r\n\r\n<p>SELECT * FROM sign_ins WHERE username LIKE &#39;Test&#39; AND result LIKE &#39;Invalid credentials&#39;&nbsp; ORDER BY created_at DESC;</p>\r\n','<p>Выведены все записи со статусом попыток входа пользователя с неправильным паролем, первая запись содержит время последней попытки.</p>\r\n\r\n<p>Пример результата запроса:</p>\r\n\r\n<p>6&nbsp;&nbsp; &nbsp;Test&nbsp;&nbsp; &nbsp;browser&nbsp;&nbsp; &nbsp;2020-08-24 11:05:35.0&nbsp;&nbsp; &nbsp;172.18.0.3&nbsp;&nbsp; &nbsp;Invalid credentials</p>\r\n',1,1),(661,1,'<p>Проверить, что выводится меню переходов по сайту</p>\r\n','<p>В хидере выводится меню со значениями:</p>\r\n\r\n<p>1. Купить\\Продать</p>\r\n\r\n<p>2. Вход\\Регистрация</p>\r\n\r\n<p>3. Счета</p>\r\n\r\n<p>4. Панель управления</p>\r\n',1,1),(662,2,'<p>Проверить, что хидер содержит ссылку перехода на главную страницу.</p>\r\n','<p>В левой части хидера находится логотип &quot;fancrypto.ru&quot;. Ссылка имеет значение &quot;https://fancrypto.ru&quot;</p>\r\n',1,1),(663,3,'<p>Проверить, что выводятся&nbsp; информационно-навигационные ссыки</p>\r\n','<p>Футер содержит три блока с ссылками.</p>\r\n\r\n<p>1 Блок - Services:</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://fancrypt