дку &quot;Платежи от меня&quot;</p>\r\n','<p>На странице выводится таблица, содержащая записи по платежам пользователя, таблица содержит столбцы:</p>\r\n\r\n<ul>\r\n	<li>#</li>\r\n	<li>Сумма</li>\r\n	<li>Парнёр</li>\r\n	<li>Статус</li>\r\n	<li>Время</li>\r\n</ul>\r\n',1,1),(1031,11,'<p>Выбрать вкладку &quot;Сообщения&quot;</p>\r\n','<p>На странице выводится список сообщений, отправленных пользователю</p>\r\n',1,1),(1032,1,'<p>Выбрать в селекторе поиска &quot;Счёт&quot;</p>\r\n','<p>Выбран пункт &quot;Счёт&quot;</p>\r\n',1,1),(1033,2,'<p>Ввести в поле ввода &quot;Введите номер счёта или платежа&quot; номер существующего счёта</p>\r\n','<p>Поле заполнено</p>\r\n',1,1),(1034,3,'<p>Нажать кнопку &quot;Найти&quot;</p>\r\n','<p>На странице выведена информация по указанному счёту</p>\r\n',1,1),(1035,1,'<p>Выбрать в селекторе поиска &quot;Платёж&quot;</p>\r\n','<p>Выбран пункт &quot;Платёж&quot;</p>\r\n',1,1),(1036,2,'<p>Ввести в поле ввода &quot;Введите номер счёта или платежа&quot; номер не существующего счёта</p>\r\n','<p>Поле заполнено</p>\r\n',1,1),(1037,3,'<p>Нажать кнопку &quot;Найти&quot;</p>\r\n','<p>На странице выводится красный алерт с текстом &quot; Платёж не найден. &quot;</p>\r\n',1,1),(1038,1,'<p>Выбрать в селекторе поиска &quot;Счёт&quot;</p>\r\n','<p>Выбран пункт &quot;Счёт&quot;</p>\r\n',1,1),(1039,2,'<p>Ввести в поле ввода &quot;Введите номер счёта или платежа&quot; номер не существующего счёта</p>\r\n','<p>Поле заполнено</p>\r\n',1,1),(1040,3,'<p>Нажать кнопку &quot;Найти&quot;</p>\r\n','<p>На странице выводится красный алерт с текстом &quot; Счет не найден. &quot;</p>\r\n',1,1),(1041,1,'<p>Выбрать в селекторе поиска &quot;Платёж&quot;</p>\r\n','<p>Выбран пункт &quot;Платёж&quot;</p>\r\n',1,1),(1042,2,'<p>Ввести в поле ввода &quot;Введите номер счёта или платежа&quot; номер существующего платежа</p>\r\n','<p>Поле заполнено</p>\r\n',1,1),(1043,3,'<p>Нажать кнопку &quot;Найти&quot;</p>\r\n','<p>На странице выведена информация по указанному платежу</p>\r\n'