/p>\r\n',1,1),(1058,4,'<p>Проверить, что есть меню перехода внизу таблицы между страницами вывода</p>\r\n','<p>Внизу таблицы имеется навигация между страницами результата поиска в числовом формате</p>\r\n',1,1),(1059,5,'<p>Проверить, что пагинационная панель содержит 6 страниц</p>\r\n','<p>Панель состоит из значений 1,2,3,4,5,6</p>\r\n',1,1),(1060,1,'<p>Выполнить процедуру поиска имеющейся сделки по продаже</p>\r\n','<p>Найдена сделка по продаже</p>\r\n',1,1),(1061,2,'<p>Нажать кнопку &quot;Продать&quot;</p>\r\n','<p>Выполнен переход на страницу &quot;Продажа&quot;</p>\r\n',1,1),(1062,3,'<p>Проверить, что выводится ошибка</p>\r\n','<p>На странице &quot;Продажа&quot; выводится ошибка в виде красного текста &quot;Для совершения продажи, пользователь должен быть авторизован&quot;</p>\r\n',1,1),(1063,1,'<p>Заполнить поле &quot;Сумма&quot; числовым значением в диапозоне 1- &infin; , где значение входит в диапозон имеющихся сделок по покупке</p>\r\n','<p>Поле заполнено числом</p>\r\n',1,1),(1064,2,'<p>Выбрать в селекторе &quot;Страна&quot; страну с интересующей сделкой</p>\r\n','<p>Селектор &quot;Страна&quot; имеет значение страны</p>\r\n',1,1),(1065,3,'<p>Выбрать в селекторе &quot;Фиатная валюта&quot; значение валюты интересующей сделки</p>\r\n','<p>Селектор &quot;Фиатная валюта&quot; имеет значение валюты</p>\r\n',1,1),(1066,4,'<p>Выбрать в селекторе &quot;Способ оплаты&quot; интересующий способ оплаты</p>\r\n','<p>Селектор &quot;Способ оплаты&quot; имеет значение способа оплаты</p>\r\n',1,1),(1067,5,'<p>Нажать кнопку &quot;Поиск&quot;</p>\r\n','<p>В таблице под строкой поиска выведена таблица, таблица содержит все сделки, подходящие под условия фильтра</p>\r\n',1,1),(1068,1,'<p>Заполнить фильтры строки поиска</p>\r\n','<p>Фильтр заполнен в соответствии с подготовленными сделками</p>\r\n',1,1),(1069,2,'<p>Нажать кнопку &quot;Поиск&quot;</p>\r\n','<p>Под меню поиска выведена таблица с результатами поиска</p>\r\n',1,1),(1070,3,'<p>Проверить, что в таблице выведено 50 знач