INSERT INTO `testplans` VALUES (3,1,'<p>Объект тестирования:<br />\r\nКриптовалютная биржа, выполненая в виде Web-приложения</p>\r\n\r\n<p>Цели тестирования:<br />\r\nПредоставление своевременной актуальной обратной связи по проекту всем заинтересованным лицам в рамках критериев качества: функциональность, надёжность, практичность, эффективность.</p>\r\n\r\n<p>Дата завершения первого этапа разработки: III-IV квартал 2020<br />\r\nДата сдачи проекта: III-IV квартал 2020<br />\r\nОбласть тестирования:<br />\r\n1) Функциональное тестирование</p>\r\n\r\n<p>2) Автоматизация функционального тестирования</p>\r\n\r\n<p>3) Тестирование взаимодействия приложения с БД</p>\r\n\r\n<p>Вне области тестирования:<br />\r\n1) Тестирование безопасности</p>\r\n\r\n<p>2) Нагрузочное тестирование</p>\r\n\r\n<p>3) Тестирование Ui/Ux</p>\r\n\r\n<p>4) Конфигурационное тестирование</p>\r\n\r\n<p>5) Тестирование на отказ и восстановление</p>\r\n\r\n<p>6) Тестирование установки</p>\r\n\r\n<p>7) Не будет регрессионного тестирования для всех платформ</p>\r\n\r\n<p>8) Автоматизация всех тестов для всех видов тестирования</p>\r\n\r\n<p>Критерии входа в тестирование:<br />\r\n1) Реализован MVP продукта</p>\r\n\r\n<p>2) Реализован GUI для взаимодействия</p>\r\n\r\n<p>3) Настроена интеграция с БД и развернуто приложение на тестовом стенде</p>\r\n\r\n<p>4) Отсутствие известных блокирующих дефектов</p>\r\n\r\n<p>Критерии выхода из&nbsp;тестирования:<br />\r\n1) Выполнен запланированный объём тестирования</p>\r\n\r\n<p>2) Нет выявленных и не закрытых дефектов с высоким приоритетом или критичностью</p>\r\n\r\n<p>3) Низкоприоритетные дефекты не влияют на основные сценарии работы и их списки согласованы со всеми заинтересованными лицами</p>\r\n\r\n<p>Риски:<br />\r\n1) Наличие дефектов на не приоритетных платформах</p>\r\n\r\n<p>2) Недоступность тестовых сред</p>\r\n\r\n<p>3) Отсутствие тестов на часть функционала из-за отсутствия документации</p>\r\n\r\n<p>4) Отсутствие документации</p>\r\n\r\n<p>5) Ошибки, выявляемые видами тестирования, которое остаётся вне области тестирования.</p>\r\n\r\n<p>6) Некорректная оценка трудозатрат</p>\r\n\r\n<p><br />\r\nТестовое окружение:<br />\r\n1) Приложения располагаются в Docker контейнерах</p>\r\n\r\n<p>2) Предполагается, что большая часть пользователей будет работать через браузеры Google Chrome, Mozilla Firefox, Opera</p>\r\n\r\n<p>3) Тестирование базируется в TestLink, автотесты базируются в GitHub</p>\r\n\r\n<p>Временные оценки:<br />\r\n1) Планирование - 3&nbsp;дня</p>\r\n\r\n<p>2) Тест-анализ и Тест-дизайн - 8&nbsp;дней</p>\r\n\r\n<p>3) Разработка тестовых скриптов - 21&nbsp;дней</p>\r\n\r\n<p>4) Выполнение тестов - 6&nbsp;дней</p>\r\n\r\n<p>5) Подведение итогов - 1 день</p>',1,1,1,'a88e73ef697b83091ee7a1636704084d8194bbd4539285236f7800c567ab3b6d');
/*!40000 ALTER TABLE `testplans` ENABLE KEYS */;
